FeedPackage.Description:
Use to remove white spaces in razor.Work With MVC3 above How to use it: Insert two lines below in Global.asax file， ViewEngines.Engines.Clear(); ViewEngines.Engines.Add(new ViewEngineAgent());
Then view the source code in the browser, you will find page compressed.
Note: the default Layout in _ViewStart.cshtml shouldn't be changed, or this can't find the layout page.

